import { Field, getFormValues, reduxForm, change } from "redux-form"
import { connect } from "react-redux";
import NonInterchangeableConfiguratorOutput from "./NonInterchangeableConfiguratorOutput";
import './NonInterchangeableConfiguratorForm.css';
import { gql, useQuery } from "@apollo/client";

let GET_OPTIONS = gql`
query GetParameters {
    getAccuracies{
      accuracyCode
      accuracyLabel
    }

    getAccessories{
      accessoryCode
      accessoryLabel
    }

    getBlockTypesA{
      blockTypeCode
      blockTypeLabel
    }

    getBlockTypesB{
      blockTypeCode
      blockTypeLabel
    }

    getMountTypes{
      mountTypeCode
      mountTypeLabel
    }

    getPreloads {
      preloadCode
      preloadLabel
      preloadCondition
    }

    getSpecialTreatmentTypes{
      treatmentCode
      treatmentLabel
    }
  }
`
/*
{
    "data": {
        "getAccuracies": [
            {
                "accuracyCode": "N",
                "accuracyLabel": "Normal",
                "__typename": "Accuracy"
            },
            {
                "accuracyCode": "H",
                "accuracyLabel": "Senior",
                "__typename": "Accuracy"
            },
            {
                "accuracyCode": "P",
                "accuracyLabel": "Precision",
                "__typename": "Accuracy"
            },
            {
                "accuracyCode": "SP",
                "accuracyLabel": "High Precision",
                "__typename": "Accuracy"
            }
        ],
        "getAccessories": [
            {
                "accessoryCode": "S",
                "accessoryLabel": null,
                "__typename": "Accessory"
            },
            {
                "accessoryCode": "S",
                "accessoryLabel": null,
                "__typename": "Accessory"
            },
            {
                "accessoryCode": "",
                "accessoryLabel": null,
                "__typename": "Accessory"
            }
        ],
        "getBlockTypesA": [
            {
                "blockTypeCode": "H",
                "blockTypeLabel": "High Profile",
                "__typename": "BlockType"
            },
            {
                "blockTypeCode": "S",
                "blockTypeLabel": "Low Profile",
                "__typename": "BlockType"
            }
        ],
        "getBlockTypesB": [
            {
                "blockTypeCode": "A",
                "blockTypeLabel": "Flange type",
                "__typename": "BlockType"
            },
            {
                "blockTypeCode": "B",
                "blockTypeLabel": "Square block",
                "__typename": "BlockType"
            },
            {
                "blockTypeCode": "AL",
                "blockTypeLabel": "Extended flange type",
                "__typename": "BlockType"
            },
            {
                "blockTypeCode": "BL",
                "blockTypeLabel": "Extended square block",
                "__typename": "BlockType"
            }
        ],
        "getMountTypes": [
            {
                "mountTypeCode": "R",
                "mountTypeLabel": "From above",
                "__typename": "MountType"
            },
            {
                "mountTypeCode": "K",
                "mountTypeLabel": "From below",
                "__typename": "MountType"
            }
        ],
        "getPreloads": [
            {
                "preloadCode": "Z0",
                "preloadLabel": "No preload",
                "preloadCondition": "Fixed load direction with low impact and low precision",
                "__typename": "Preload"
            },
            {
                "preloadCode": "Z1",
                "preloadLabel": "Middle preload",
                "preloadCondition": "Light load and high precision",
                "__typename": "Preload"
            },
            {
                "preloadCode": "Z2",
                "preloadLabel": "Heavy preload",
                "preloadCondition": "Requirements for rigidity, vibration and impact",
                "__typename": "Preload"
            }
        ],
